canonical_solution:
class Solution:
    def circularPermutation(self, n: int, start: int) -> List[int]:
        return [i ^ (i >> 1) ^ start for i in range(1 << n)]

inefficient_solution:
class Solution:
    def circularPermutation(self, n: int, start: int) -> List[int]:
        def generate_permutations(n, start, seen):
            if n == 0:
                return [start]
            permutations = []
            for i in range(1 << n):
                if i not in seen:
                    seen.add(i)
                    permutations.append(i)
                    permutations.extend(generate_permutations(n - 1, i ^ (i >> 1) ^ start, seen))
                    seen.remove(i)
            return permutations

        return generate_permutations(n, start, set())
